function loginsocial(pr){
	var provider;
	if(pr=="g"){
		provider = new firebase.auth.GoogleAuthProvider();
	}else if(pr=="f"){
		provider = new firebase.auth.FacebookAuthProvider();
	}else if(pr=="t"){
		provider = new firebase.auth.TwitterAuthProvider();
	}else{
		alert("ha ocurrido un error al iniciar sesión");
	}

	firebase.auth().signInWithPopup(provider).then(function(result) {
	  var token = result.credential.accessToken;
	  var secret = result.credential.secret;
	  var user = result.user;
	  guardarusuario(user);
	}).catch(function(error) {
	  var errorCode = error.code;
	  var errorMessage = error.message;
	  console.log(errorMessage);
	  var email = error.email;  var credential = error.credential;
	});
}

function guardarusuario(u){
	db.child(clgappid+'/usuarios').once('value', function(snap){
		if(!snap.hasChild(u.uid)){
			// console.log(u.providerData[0].uid);
			// console.log(u.providerData[0].providerId);
			db.child(clgappid+'/usuarios/'+u.uid).set({
				uid: u.uid,
		    nombre: u.displayName || u.email.split('@')[0],
		    email: u.email,
		    foto : u.photoURL || 'data:image/png;base64,',
		    puntaje: 0,
		    proveedor: u.providerData[0].providerId,
		    socid: u.providerData[0].uid || '0'
			},function(err){
				if(err){
					console.log('Ocurrió un error al guardar al usuario');
				}else{
					console.log('El usuario se guardó correctamente');
				}
			});
		}else{
			console.log('el usuario no debe ser guardado');
		}
	});
}

