// OTRAS FUNCIONES
function showpop2(principal, secundario, titulo, puntos){
	// mision.textoprincipal,mision.textosecundario,mision.nombre,mision.puntaje
	// Felicidades, has cumplido la misión, Tu primer comentario, 200
	if(arguments.length>2){
		// console.log('más de 2');
		principal = principal || '';
		secundario = secundario || '';
		titulo = titulo || '';
		puntos = puntos || '';
	}else{
		// console.log('menos de 2');
		titulo = principal || 'Ganaste';
		puntos = secundario || '';
		principal = '';
		secundario= '';
	}
	// estamos probando con misiones tipo 0 (selectores: #id .clase)
	// console.log(principal+' '+titulo+'<br/>'+secundario+' '+puntos+' '+clgsufijo);
	var monos = {
		mono1: { //hipo
			cuadrado: 'data:image/png;base64,',
			circulo: 'data:image/png;base64,',
			rectangulo: 'data:image/png;base64,'
		},
		mono2: { //koa
			cuadrado: 'data:image/png;base64,',
			circulo: 'data:image/png;base64,',
			rectangulo: 'data:image/png;base64,'
		},
		mono3: { //pere
			cuadrado: 'data:image/png;base64,',
			circulo: 'data:image/png;base64,',
			rectangulo: 'data:image/png;base64,'
		},
		mono4: { //boy
			cuadrado: 'data:image/png;base64,',
			circulo: 'data:image/png;base64,',
			rectangulo: 'data:image/png;base64,'
		}
	}


	var bgprincipal = $('.tabsclg nav a.selected').css('background-color');
	var popstyles = 'position:fixed;z-index:99999999;background:white;opacity:0;-webkit-transition:.5s ease;-moz-transition:.5s ease;transition:.5s ease;width:auto;height:auto;';
	var popmsgstyles;
	var titlesboxstyles;
	if(configpop.forma != 'tamrectangular'){
		titlesboxstyles= '';
		popmsgstyles= 'display: flex;flex-direction: column;align-items: center;justify-content: center;background: '+bgprincipal+';border: 1px solid white;border-radius:10px;color:white;border-style: dashed;';
	}else{
		titlesboxstyles= 'display: flex;align-items: center;';
		popmsgstyles= 'display: flex;flex-direction: column;align-items: center;justify-content: center;background: '+bgprincipal+';border: 1px solid white;border-radius:10px;color:white;border-style: dashed;';
	}
	var mono = {};
	// if(configpop.mono == 'monopop2'){
		mono.width = '180px';
		mono.height = '180px';
		mono.flip ='';
	// mono.data = "data:image/png;base64,";
	// }

	/*Mono1 Hipo*/
	if(configpop.mono == 'monopop1'){
		if(configpop.forma == 'tamrectangular'){
			mono.data = monos.mono1.rectangulo;
		}
		if(configpop.forma == 'tamcuadrado'){
			mono.data = monos.mono1.cuadrado;
		}
		if(configpop.forma == 'tamredondo'){
			mono.data = monos.mono1.circulo;
		}
	}

	/*Mono2 Koa*/
	if(configpop.mono == 'monopop2'){
		if(configpop.forma == 'tamrectangular'){
			mono.data = monos.mono2.rectangulo;
		}
		if(configpop.forma == 'tamcuadrado'){
			mono.data = monos.mono2.cuadrado;
		}
		if(configpop.forma == 'tamredondo'){
			mono.data = monos.mono2.circulo;
		}
	}

	/*Mono3 Pere*/
	if(configpop.mono == 'monopop3'){
		if(configpop.forma == 'tamrectangular'){
			mono.data = monos.mono3.rectangulo;
		}
		if(configpop.forma == 'tamcuadrado'){
			mono.data = monos.mono3.cuadrado;
		}
		if(configpop.forma == 'tamredondo'){
			mono.data = monos.mono3.circulo;
		}
	}

	/*Mono4 Boy*/
	if(configpop.mono == 'monopop4'){
		if(configpop.forma == 'tamrectangular'){
			mono.data = monos.mono4.rectangulo;
		}
		if(configpop.forma == 'tamcuadrado'){
			mono.data = monos.mono4.cuadrado;
		}
		if(configpop.forma == 'tamredondo'){
			mono.data = monos.mono4.circulo;
		}
	}

	
	// redondo
		if(configpop.forma == 'tamredondo'){
			popmsgstyles += 'width:150px;height:150px;border-radius:100%;text-align:center;position:absolute;';

			if(configpop.posicion == 'poslt'){ //izquierda arriba
				popstyles += 'top:70px;left:-15px;';
				popmsgstyles += 'left: 140px;top: -55px;';
			}

			if(configpop.posicion == 'poslb'){ //izquierda abajo
				popstyles += 'bottom:300px;left:-15px;';
				popmsgstyles += 'left: 140px;top: -55px;';
			}

			if(configpop.posicion == 'posrt'){ //derecha arriba
				mono.flip ='clgimgflip';
				popstyles += 'top:70px;right:175px;';
				popmsgstyles += 'right: -40px;top: -51px;';
			}

			if(configpop.posicion == 'posrb'){ //derecha abajo
				mono.flip = 'clgimgflip';
				popstyles += 'bottom:400px;right:175px;';
				popmsgstyles += 'right: -40px;top: -51px;';
			}
		}
	// fin redondo

	// cuadrado
		if(configpop.forma == 'tamcuadrado'){
			popmsgstyles += 'width:150px;height:150px;text-align:center;position:absolute;';

			if(configpop.posicion == 'poslt'){ //izquierda arriba
				popstyles += 'top:20px;left:35px;';
				popmsgstyles += 'left: 12px;top: 128px;';
			}

			if(configpop.posicion == 'poslb'){ //izquierda abajo
				popstyles += 'bottom:400px;left:35px;';
				popmsgstyles += 'left: 12px;top: 128px;';
			}

			if(configpop.posicion == 'posrt'){ //derecha arriba
				mono.flip ='clgimgflip';
				popstyles += 'top:20px;right:195px;';
				popmsgstyles += 'right: -170px;top: 128px;';
			}

			if(configpop.posicion == 'posrb'){ //derecha abajo
				mono.flip ='clgimgflip';
				popstyles += 'bottom:400px;right:195px;';
				popmsgstyles += 'right: -170px;top: 128px;';
			}
		}
	// fin cuadrado

	// rectangular
		if(configpop.forma == 'tamrectangular'){
			popmsgstyles += 'width:350px;height:90px;text-align:center;position:absolute;';

			if(configpop.posicion == 'poslt'){ //izquierda arriba
				popstyles += 'top:20px;left:-15px;';
				popmsgstyles += 'left: 84px;top: 84px;';
			}

			if(configpop.posicion == 'poslb'){ //izquierda abajo
				popstyles += 'bottom:400px;left:-15px;';
				popmsgstyles += 'left: 84px;top: 84px;';
			}

			if(configpop.posicion == 'posrt'){ //derecha arriba
				mono.flip ='clgimgflip';
				popstyles += 'top:20px;right:165px;';
				popmsgstyles += 'right: -96px;top: 84px;';
			}

			if(configpop.posicion == 'posrb'){ //derecha abajo
				mono.flip ='clgimgflip';
				popstyles += 'bottom:400px;right:165px;';
				popmsgstyles += 'right: -96px;top: 84px;';
			}
		}
	// fin rectangular
	var popup;

	if(principal!='' && secundario!=''){
		var customstyle1 = '';
		if(configpop.forma == 'tamrectangular'){
			customstyle1 = 'margin-left:0.6em';
		}
		popup = '<div id="clgpopup" style="'+popstyles+'">'+
									'<div class="clgsabana" style="position: fixed;width: 100vw;height: 100vh;left: 0;top: 0;background-color: rgba(0,0,0,0.4);margin: 0;padding: 0;opacity: 0;transition: 1s all ease;display:none;"></div>'+
									'<div id="popimg" style="position:absolute;">'+
										'<img style="position:relative;z-index:1;" class="'+mono.flip+'" width="'+mono.width+'" height="'+mono.height+'" src="'+mono.data+'">'+
									'</div>'+
									'<div id="popmsg" style="'+popmsgstyles+'">'+
										'<div style="'+titlesboxstyles+'">'+
											'<h3 style="margin:0;padding:0;color:white;">'+principal+'</h3>'+
											'<h4 style="margin:0;padding:0;color:white;'+customstyle1+';">'+secundario+'</h4>'+
										'</div>'+
										'<p style="margin: 4px 0 0 0;padding:0;color:white;">'+titulo+'<br>'+puntos+' '+clgsufijo+'</p>'+
									'</div>'+
								'</div>';
	}else{ //para las las configuraciones antiguas (sólo mensaje y puntaje)
		popup = '<div id="clgpopup" style="'+popstyles+'">'+
									'<div class="clgsabana" style="position: fixed;width: 100vw;height: 100vh;left: 0;top: 0;background-color: rgba(0,0,0,0.4);margin: 0;padding: 0;opacity: 0;transition: 1s all ease;display:none;"></div>'+
									'<div id="popimg" style="position:absolute;">'+
										'<img style="position:relative;z-index:1;" class="'+mono.flip+'" width="'+mono.width+'" height="'+mono.height+'" src="'+mono.data+'">'+
									'</div>'+
									'<div id="popmsg" style="'+popmsgstyles+'">'+
										'<h3 style="margin:0;padding:0;color:white;">'+titulo+'</h3>'+
										'<p style="margin: 4px 0 0 0;padding:0;color:white;">'+puntos+'pts</p>'+
									'</div>'+
								'</div>';
	}

	// se agrega al body, luego de 0.x segundos se muestra con opacity 1
	$('body').append(popup);
	setTimeout(function() {
		$('#clgpopup').css('opacity','1');
		$('#clgpopup .clgsabana').css('display','block');
		$('#clgpopup .clgsabana').css('opacity','1');
	},600);
	
	var tiempo = configpop.tiempo ? (configpop.tiempo * 1000) : 3600;
	// console.log('tiempo pop: ' + tiempo);
	// después de x segundos opacity 0, y luego de x segundos se elimina del body
	setTimeout(function() {
		$('#clgpopup').css('opacity','0');
	  $('#clgpopup .clgsabana').css('opacity','0');
		setTimeout(function() {
			$('#clgpopup').remove();
		},600);
	},tiempo);
}

