	    'background: url("data:image/png;base64,");'+
	    'border-radius: 50px;'+
	    'position: relative;'+
	    'bottom: 113%;'+
	    'left: 1%;'+
  	'}'+
	'</style>';
	var estilosp = {
		color: 'white',
		position: 'relative',
		top: '-11%',
		left: '24%'
	}
	$('body').append(popup);
	$('body').append(estilosdivafter);
	$('#clgnoti').css(estilosdiv);
	$('#clgnoti p').css(estilosp);
	// $('#clgnoti').animate({}, 'slow');
	$('#clgnoti').animate({width: '200px'}, 1000);
	$('#clgnoti').animate({opacity: 1}, {
		duration:1500,
		complete: function(){
			setTimeout(function() {
				$('#clgnoti').animate({opacity: 0}, {
					duration:1500,
					complete: function(){
						// $('#clgnoti').remove();
						// $('#clgnotiaftercss').remove();
					}
				});
			},3000);
		}
	});
	
