// PARA KE APAREZCAN CON ANIMACION
$('.tabsclg a').on('click', function(){
	
	if( $('.desafiosbox').hasClass('visible') ){ //MISIONES
		var delay = 300;
		var desafios = $('.desafiosbox').find('.desafio');
		$(desafios).each(function(i, obj){
			setTimeout(function() {
    		$('#'+obj.id).addClass('show');
  		}, delay);
  		delay = delay + 500;
		});
	} //IF MISIONES

	if( $('.logrosbox').hasClass('visible') ){ //LOGROS
		var delay = 300;
		var logros = $('.logrosbox').find('.logro');
		$(logros).each(function(i, obj){
			setTimeout(function() {
    		$('#'+obj.id).addClass('show');
  		}, delay);
  		delay = delay + 500;
		});
	} //IF LOGROS

});
// FIN APAREZCA CON ANIMACIONES

